import React from 'react'
import ReactDOM from 'react-dom'
import { Route, Switch } from 'react-router'
import Home from './Home'

const App = () => {
  return (
    <>
      <Switch>
      <Route path="/" component={Home}/>
      </Switch>
    </>
  )
}
export default App;
